import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import {Link} from 'react-router-dom';
import socket from './SocketUser';
import GoogleLogin from 'react-google-login';


class Login extends Component {

  constructor(props){
    super(props);
  }


  render() {
    return (<h1> Login </h1>);
  }
}

const responseGoogle = (response) => {
  console.log(response);
}


// onSuccess={(response) => { this.setState({ userLoggedIn: true, }, () => { localStorage.setItem('userLoggedIn', true); });

ReactDOM.render(
  <GoogleLogin
    clientId="273539098251-5nhctai82l0ram9s38gkp7s22ahc4lui.apps.googleusercontent.com"
    buttonText="Login"
    onSuccess={responseGoogle}
    onFailure={responseGoogle}
    cookiePolicy={'single_host_origin'}
  />,
  document.getElementById('googleButton')
);

var test = document.getElementById("test");

test.addEventListener("click", function(){
  socket.emit("createWorkspace", "NAME", "URL");
  console.log("ENTERED");
});

console.log('before the emission');
socket.emit('test', {testing: "0000"});

socket.on("sendingattempt", function(data){
  console.log(data.attempt);
});



export default Login;
